    this(RtGithub.REQUEST.header(HttpHeaders.AUTHORIZATION, String.format("Basic %s", DatatypeConverter.printBase64Binary(String.format("%s:%s", user, pwd).getBytes(StandardCharsets.UTF_8)))));
